import { LOGIN } from "./login";

const password = ""

const userReducer = (state = password, action) => {
    const test = Object.assign({}, password)
    test.email = action.payload?.email
    test.name = action.payload?.name
    switch (action.type) {
        case LOGIN:
            console.log(action)
            return {
                ...state,
                test
            }
        default: return state;
    }
}

export default userReducer
